import React, { useState } from 'react';
import './SideNav.css';

function SideNav() {
    const menuIcon = document.getElementById("menu-icon");
    const sideNav = document.querySelector(".side-nav");

    // Define la media query
    const mediaQuery = window.matchMedia("(max-width: 768px)");

    // Función para manejar el click en el icono del menú
    function handleMenuClick() {
        sideNav.classList.toggle("collapsed");
    }

    // Agrega el event listener para el click en el icono del menú
    menuIcon.addEventListener("click", handleMenuClick);

    // Función para manejar el click fuera del sideNav
    function handleDocumentClick(event) {
        if (!sideNav.contains(event.target) && !menuIcon.contains(event.target)) {
            sideNav.classList.remove("collapsed");
        }
    }

    // Agrega el event listener solo si se cumple la media query
    if (mediaQuery.matches) {
        document.addEventListener("click", handleDocumentClick);
    }

    // Escucha los cambios en la media query
    mediaQuery.addEventListener("change", function(e) {
        if (e.matches) {
            document.addEventListener("click", handleDocumentClick);
        } else {
            document.removeEventListener("click", handleDocumentClick);
        }
    });

  return (
    <div class="side-nav">
        <div class="padding">
            <div class="nav-header" id="menu-icon">
                <div class="nav-item">
                    <a href="#">
                        <i class="fas fa-bars menu-icon" style="font-size: 17px;"></i>
                        <span class="menu-text"></span>
                    </a>
                </div>
                <h3 class="menu-title" style="margin-top: 0px;">Lancaster</h3>
            </div>

            <div class="asd">
                <div class="nav-item" title="Clientes"><a href="index.html"><i class="fa-solid fa-house"></i> <span
                    class="menu-text">Principal</span></a></div>
                <div class="nav-item" title="Clientes"><a href="clientes.html"><i class="fa-solid fa-users"></i> <span
                            class="menu-text">Clientes</span></a></div>
                <div class="nav-item" title="Clientes"><a href="saldos.html"><i class="fa-solid fa-hand-holding-dollar"></i> <span
                            class="menu-text">Por Cobrar</span></a></div>
                <div class="nav-item" title="Clientes"><a href="pendientes.html"><i class="fa-solid fa-money-check-dollar"></i> <span
                            class="menu-text">Por pagar</span></a></div>
                <div class="nav-item"><a href="#"><i class="fas fa-calendar-alt"></i> <span
                            class="menu-text">Events</span></a></div>
                <div class="nav-item"><a href="#"><i class="fas fa-info-circle"></i> <span
                            class="menu-text">About</span></a></div>
                <div class="nav-item"><a href="#"><i class="fas fa-cogs"></i> <span class="menu-text">Services</span></a>
                </div>
                <div class="nav-item"><a href="#"><i class="fas fa-envelope"></i> <span class="menu-text">Contact</span></a>
                </div>
            </div>
            
        </div>
        <div class="logout">
            <a href="login.html"><i class="fas fa-sign-out-alt"></i> <span class="menu-text">Cerrar Sesión</span></a>
        </div>
    </div>
  );
}

export default SideNav;
